import React from 'react';
import ReactDOM from 'react-dom'; // Correct import statement
import AuthContextProvider from '../src/context/auth-context';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <AuthContextProvider>
        <App />
    </AuthContextProvider>
);
